{'sentences': ['This post was contributed by a community member.', 'Business & Tech 5-Star Savings Bank of Danbury Building a Better Future Together Savings Bank of Danbury Earns 5-Star rating from BauerFinancial for financial strength and stability Reply

BauerFinancial, Inc., the Nation’s Premier Bank Rating Firm, is pleased to announce that Savings Bank of Danbury has earned its top (5-Star) rating for financial strength and stability.', 'This latest rating was assigned in September 2023 based on June 30, 2023 financial data and signifies that Savings Bank of Danbury is among the strongest banks in the nation.



', '“As a community bank, Savings Bank of Danbury keeps its focus on consumers, small businesses and the community at hand”, remarks Karen Dorway, President of BauerFinancial.', 'Bauer rates every federally-insured U.S. chartered bank with the same strict standards, and is honored to report that Savings Bank of Danbury has earned its 5-Star rating.']}

{'sentences': ['This post was contributed by a community member.', 'Community Corner Savings Bank of Danbury Foundation Grant Applications Available Non-Profit Organizations can now apply for grant funding.', 'Reply

The Savings Bank of Danbury Foundation has announced that applications are available for local non-profit agencies to apply for grants with applications due by October 2, 2023.



', 'The Savings Bank of Danbury Foundation awarded $277,500 to 108 organizations in 19 communities in 2022.', 'The Savings Bank of Danbury is proud of our commitment to provide financial support to organizations vital to the well-being, growth and prosperity in the communities we serve.” said Stacy Singer, Assistant Vice President and Community Development Officer of Savings Bank of Danbury.']}
